import React from 'react';
import { Component } from 'react';
import axios from 'axios';
import { useHistory } from 'react-router-dom';

const Home = () => {
  const history = useHistory();

  const handleLoginButtonClick = () => {
    history.push('/login'); // Navigate to the login page
  };

  const handleSignupButtonClick = () => {
    history.push('/signup'); // Navigate to the signup page
  };

  return (
    <div className="tv-1">
      <div className="tv-1-child">
        <h1 className="lets-get-you">Which page do you want to go?</h1>

        <button className="loginButton" onClick={handleLoginButtonClick}>
          <div className="login-wrapper">
            <div className="login">Login to existing Account.</div>
          </div>
        </button>

        <button className="signupbutton" onClick={handleSignupButtonClick}>
          <div className="signup-wrapper">
            <div className="signup">Create an Account</div>
          </div>
        </button>
      </div>
    </div>
  );
};

export default Home;
